/* IMPORT */
import isLength from './is_length.js';
import isObjectLike from './is_object_like.js';
import isString from './is_string.js';
/* MAIN */
const isArrayLike = (value) => {
    return (isString(value) || isObjectLike(value)) && isLength(value['length']);
};
/* EXPORT */
export default isArrayLike;
